import React from "react";

import "./AboutMe.css";
import DP from "../Pictures/DP.png";

function AboutMe() {
  return (
    <>
      <div className="container3">
        <div className="heading">About Me</div>
        <div className="box2">
          <img className="displayPicture" src={DP} alt="KhushbooSingh" />
          <p className="intro">
            I’m Seán, a Product Designer working remotely for Help Scout on
            their mobile products in sunny Dublin, Ireland. I’ve spent the past
            12+ years working across different areas of digital design;
            front-end development, email design, marketing site pages, app
            UI/UX, to my current role designing products for mobile platforms.
            These days my time is spent researching, designing, prototyping, and
            coding. I also help designers get started with their careers. Out of
            the office you’ll find me dreaming of soccer, playing bass guitar,
            and petting all the good dogs.
          </p>
        </div>
      </div>
    </>
  );
}

export default AboutMe;
